import "./App.css";
import React from "react";
import Sudoku from "./Sudoku";

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>Sūdoku ~ 数独 ~ すうどく</h1>
      </header>
      <Sudoku />
    </div>
  );
}

export default App;
